import React, { useState } from "react";

const OTPVerification = ({ phoneNumber, onVerifyOTP }) => {
  const [otp, setOtp] = useState(["", "", "", ""]);

  const handleChange = (index, value) => {
    if (value.length > 1) return;
    let newOtp = [...otp];
    newOtp[index] = value;
    setOtp(newOtp);
  };

  return (
    <div className="h-screen flex items-center justify-center bg-blue-900">
      <div className="flex items-center max-w-5xl w-full px-6">
        {/* Left Side Image */}
        <div className="w-1/2 hidden md:block">
        <svg width="500" height="795" viewBox="0 0 795 795" fill="none" xmlns="http://www.w3.org/2000/svg" xlinkHref="http://www.w3.org/1999/xlink">
<g clipPath="url(#clip0_4529_41034)">
<rect width="795" height="795" fill="url(#pattern0_4529_41034)"/>
<rect x="206" y="196" width="40" height="45.0794" transform="rotate(-30 206 196)" fill="url(#pattern1_4529_41034)"/>
</g>
<defs>
<pattern id="pattern0_4529_41034" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlinkHref="#image0_4529_41034" transform="scale(0.00159744)"/>
</pattern>
<pattern id="pattern1_4529_41034" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlinkHref="#image1_4529_41034" transform="matrix(0.00353846 0 0 0.00296774 -0.384615 -0.241935)"/>
</pattern>
<clipPath id="clip0_4529_41034">
<rect width="795" height="795" fill="white"/>
</clipPath>
<image id="image0_4529_41034" width="626" height="626" preserveAspectRatio="none" xlinkHref="data:image/png;base64,"/>
<image id="image1_4529_41034" width="500" height="500" preserveAspectRatio="none" xlinkHref="data:image/png;base64,"/>
</defs>
</svg>

        </div>

        {/* Right Side OTP Box */}
        <div className="bg-white p-8 rounded-lg shadow-lg w-full md:w-1/3 ml-20">
          <h2 className="text-2xl font-semibold mb-4 text-center">Welcome Back!</h2>
          <p className="text-gray-700 text-center font-semibold">OTP Verification</p>
          <p className="text-sm text-gray-500 text-center mb-4">
            Enter 4-digit OTP sent to <span className="font-semibold">{phoneNumber}</span>
            <span className="text-blue-500 ml-2 cursor-pointer">✏️</span>
          </p>

          {/* OTP Input Boxes */}
          <div className="flex justify-center space-x-2 mb-4">
            {otp.map((digit, index) => (
              <input
                key={index}
                type="text"
                maxLength="1"
                value={digit}
                onChange={(e) => handleChange(index, e.target.value)}
                className="w-12 h-12 text-lg text-center border rounded focus:outline-none focus:ring-2 focus:ring-yellow-400"
              />
            ))}
          </div>

          <p className="text-xs text-gray-500 mt-2 text-center">
            By signing up, you agree to our{" "}
            <span className="text-blue-500 cursor-pointer">Terms of Use</span> and{" "}
            <span className="text-blue-500 cursor-pointer">Privacy Policy</span>.
          </p>

          {/* Verify OTP Button */}
          <button
            onClick={onVerifyOTP}
            className="w-full bg-yellow-400 hover:bg-yellow-500 text-black font-semibold py-2 mt-4 rounded"
          >
            Verify OTP
          </button>
        </div>
      </div>
    </div>
  );
};

export default OTPVerification;
